  [],\n\t\"revision_timestamp\": \"2015-05-07T03:43:50.316465\",\n\t\"name\": \"cradle-to-grave-monitoring-of-composite-aircraft-structures-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"NextGen is proposing a simple yet powerful
  damage identification technique for advanced composite structures.  We propose to
  develop a damage index based on vibration signature comparison with original signatures
  of the structure. Our approach is to autonomously perform damage detection as well
  as identification of non-service loading events by minimum number of sensors. We
  will start with the preliminary work done by Dr. Mal at UCLA and improve upon it
  to achieve the objective of cradle-to-grave degradation monitoring. The overall
  goal of the program is to develop an accurate, rapid, inexpensive method for detection
  of composite internal damage including bonds strength in built-up structures. The
  objective of the Phase I program is to develop and demonstrate that the proposed
  technique is accurate and reliable.  We will achieve TRL of 2 in Phase I and subsequent
  technology transition to TRL of 4 in Phase II. NextGen's strength lies in related
  prior work, an in-depth understanding of damage modes in advanced composite structures,
  and comprehensive knowledge of damage detection techniques.  Dr. Ajit Mal of the
  Mechanical Engineering Department at UCLA has an exceptional background in structural
  health monitoring built on decades of cutting edge research in NDE\",\n\t\"license_title\":
